import './login.css';

const Login = ({login})=>{
    if(login){
        return(
            <div className="login px-5">
                <input type="text" className="my-2 py-2" placeholder="Email"/>
                <input type="password" placeholder="Password" />
                <button className="my-2 btn btn-outline-dark btn-bg">Login</button>
                <span>New to us - </span>
                <a href="">Create an Account</a>
            </div>
        );
    }
    return(
        <></>
    );
}

export default Login;
